const _hoisted_6 = /* @__PURE__ */ createStaticVNode('<h2 id="info" tabindex="-1"><a class="header-anchor" href="#info" aria-hidden="true">#</a> Info</h2><p><strong>Bio-Data</strong></p><ul><li>Class: Berserker</li><li>True Name: Oda Nobunaga</li><li>Gender: Female</li><li>Source: Historical fact/\u201CDead Heat Summer Race!\u201D</li><li>Region: Japan</li><li>Alignment: Chaotic Summer</li><li>Height: 152cm</li><li>Weight: 44kg</li></ul><p><strong>Meta</strong></p><ul><li>Character Creator: Keikenchi</li><li>Character Illustrator: Pako</li><li>Character Voice: Kugimiya Rie</li><li>Appearance in Main Works: Fate/Grand Order</li></ul><h2 id="stats" tabindex="-1"><a class="header-anchor" href="#stats" aria-hidden="true">#</a> Stats</h2><table><thead><tr><th style="text-align:left;">Parameters</th><th style="text-align:center;">Values</th></tr></thead><tbody><tr><td style="text-align:left;">Strength</td><td style="text-align:center;">B</td></tr><tr><td style="text-align:left;">Constitution</td><td style="text-align:center;">C</td></tr><tr><td style="text-align:left;">Agility</td><td style="text-align:center;">B</td></tr><tr><td style="text-align:left;">Magical Power</td><td style="text-align:center;">C</td></tr><tr><td style="text-align:left;">Luck</td><td style="text-align:center;">B</td></tr><tr><td style="text-align:left;">Noble Phantasm</td><td style="text-align:center;">E~EX</td></tr></tbody></table><h2 id="class-skills" tabindex="-1"><a class="header-anchor" href="#class-skills" aria-hidden="true">#</a> Class Skills</h2><p><strong>Mad Enhancement: [C]</strong></p><p>With the exception of Luck and Mana, one\u2019s parameters are raised by one stage. The ability to communicate is lost and they become incapable of complex thinking; or that\u2019s how it was supposed to be, but she&#39;s the same as usual so the change is not too noticeable. According to the person herself, it feels like her mind that preferred quiet tea ceremonies is running wild.</p><h2 id="personal-skills" tabindex="-1"><a class="header-anchor" href="#personal-skills" aria-hidden="true">#</a> Personal Skills</h2><p><strong>The Fool\u2019s Way of Using a Sword: [A]</strong></p><p>Carrying out battles with inconceivably foolish ideas. Ding-dong dashing Buddhist temples, setting up firecrackers in teakettles and making Nobukatsu cry, she acts as she pleases. Since these sort of things are all she cared about in the first place, her close combat skills are powered up in the worst way possible.</p><p><strong>Atsumori Beat: [B]</strong></p><p>A way of using the sword that involves dancing and brings certain death, letting the beat of Atsumori resound through the battlefield. While it would be great if she made it clear whether it\u2019s a dance or song, according to Nobu, this is Rock. A superb skill that does not feel like it would bring amazing effects upon use despite seeming like that at first glance, but when used regularly it turns out to be powerful after all.</p><p><strong>Demon King of the Sixth Heaven from the Beach: [A]</strong> [1]</p><p>The monster who distorted her own existence according to her image of Summer. Her abilities and appearance ended up changing. A different version of her original \u201CDemon King\u201D skill. This is how it ended up when the Demon King changed into a swimsuit at the beach. It also feels like her chest became a bit bigger as a side effect.</p><h2 id="noble-phantasm-s" tabindex="-1"><a class="header-anchor" href="#noble-phantasm-s" aria-hidden="true">#</a> Noble Phantasm(s)</h2><h1 id="demon-king-of-the-sixth-heaven-hajun-the-height-of-summer-nobunaga-the-rock-n-roll" tabindex="-1"><a class="header-anchor" href="#demon-king-of-the-sixth-heaven-hajun-the-height-of-summer-nobunaga-the-rock-n-roll" aria-hidden="true">#</a> Demon King of the Sixth Heaven Hajun ~The Height of Summer~ (Nobunaga THE Rock &#39;n&#39; Roll)</h1><ul><li>Rank: E~EX</li><li>Classification: Anti-Divine Noble Phantasm</li><li>Range: -</li><li>Maximum number of targets: one person</li></ul><p>Nobunaga THE Rock &#39;n&#39; Roll.</p><p>The true Noble Phantasm of Demon King Nobunaga who destroys gods and Buddha...well, the slightly altered version of that.</p><p>The limited release of her Reality Marble reborn as a being that displays immense might against those that possess divinity or mystery.</p><p>Visually, a mysterious giant skeleton manifests behind Nobu&#39;s back, displaying the same power as the Demon King.</p><p>The severe acts carried out by her during her lifetime, represented by the burning of Mt. Hiei, transformed into a Noble Phantasm.</p><p>Due to the misconceptions piled on her by the populace after her death - like mistaken visual representations, wild stories and game knowledge -, she materialized as a Demon Lord of the Sixth Heaven-like existence and boasts a considerable advantage against enemies possessing divinity; however, this is a double-edged sword that is difficult to handle since it could burn even her to ashes eventually.</p><p>Since her original Demon Lord of the Sixth Heaven state is a dangerous mode that would turn not only the gods and Buddha but even her to ashes, the Demon King of the Sixth Heaven state is being limited by sealing it into the class known as Berserker.</p><p>Although she plays it off with her foolish speech and actions, this form is a fairly dangerous state for Nobunaga to be in, so she has to cool down by periodically releasing (shout) mana (rock).</p><p>In the case of a Heroic Spirit with little to no divinity, it would be just a somewhat noisy Noble Phantasm.</p><p>&quot;Nobunaga THE Rock &#39;n&#39; Ro~~~~~~ll!! YAY!!&quot;</p><h1 id="character" tabindex="-1"><a class="header-anchor" href="#character" aria-hidden="true">#</a> Character</h1><h2 id="pronouns" tabindex="-1"><a class="header-anchor" href="#pronouns" aria-hidden="true">#</a> Pronouns</h2><ul><li>First person pronoun: washi/waga</li><li>Second person pronoun: sonata/omae/kisama nado</li><li>Third person pronoun: oyatsu/are/nado</li></ul><h2 id="personality" tabindex="-1"><a class="header-anchor" href="#personality" aria-hidden="true">#</a> Personality</h2><p>The Warring States&#39; Hero of the Troubled Times, Oda Nobunaga. Called the &quot;Great Fool of Owari&quot; in her childhood, she destroyed Imagawa Yoshimoto at Okehazama and spread the tenka through the realms.</p><p>Afterwards, she defeated formidable enemies one after another, the unification of Japan in her grasp, however, due to Akechi Mitsuhide&#39;s betrayal, she passed away at Honnouji. So was she recorded.</p><p>My body clad in the burning passion welling up inside me, &quot;Nobunaga THE Rockstar&quot; makes her striking debut in the Summer of 2017!</p><p>Her fighting style closely resembles her mischievous antics during the Sengoku period when she was the Fool of Owari; and there&#39;s also Rock &#39;n&#39; Roll. Bonus points for her super cool Buster T-shirt too.</p><p>As a result of putting on a swimsuit and letting loose, she turned into a Berserker and because of this, her Demon Lord aspect is more pronounced.</p><p>Manipulating a mysterious giant skeleton, she displays close combat skills that are not shown when she is an Archer. The fuse (long-distance attack) has been thrown away.</p><p>By the way, what the heck is this skeleton?</p><h2 id="attitude-towards-master" tabindex="-1"><a class="header-anchor" href="#attitude-towards-master" aria-hidden="true">#</a> Attitude Towards Master</h2><p>It was Nobunaga who worked vigorously towards her aim of unifying the whole country, but that came to an end due to her vassal&#39;s rebellion.</p><p>She does not regret this saying &quot;It couldn&#39;t be helped&quot;. She has no particular wish for the Holy Grail, however, with that inconceivable way of thinking that she is known for, there is a high chance that she will make some kind of mess using the Holy Grail itself. It&#39;s also highly likely that she&#39;ll hold a pillow fight tournament at night while on a journey.</p><p>Going through this and that during their long collaboration, she grew quite fond of the Master.</p><p>Since she is awfully indifferent towards people she has no interest in by nature, she doesn&#39;t really put it into words much, but she seems to have a fairly high opinion of them.</p><p>Uhhahha! For me to take such a liking to you, you&#39;re truly a lucky fellow, aren&#39;t you!</p><p>Leaving that aside, are you not interested in things like musical instruments and bands? By the way, I am the vocalist and guitarist. It&#39;s fine for you to be just the Producer who&#39;s in charge of me if you&#39;d like?</p><h2 id="dialogue-examples" tabindex="-1"><a class="header-anchor" href="#dialogue-examples" aria-hidden="true">#</a> Dialogue Examples</h2><p>\u300CA swimsuit-clad me was inevitable!\u300D</p><p>\u300CEVERYBODY, A-TSU-MO-RI!\u300D</p><p>\u300CNojajajajajajaja-!?\u300D</p><p>\u300CI am the Demon King of the Sixth Heaven from the Beach, Oda Nobunaga!\u300D</p><p>\u300CI won! Tenka Fubu complete! I am the Demon Lord of the Sixth Heaven Rockstar from the beach, that&#39;s right, me! Please buy a copy of the CD commemorating my overall victory &quot;Atsumori THE Summer Vacation&quot; too!\u300D</p><h2 id="historical-character-and-figure" tabindex="-1"><a class="header-anchor" href="#historical-character-and-figure" aria-hidden="true">#</a> Historical Character and Figure</h2><p>Ya~y! Everyone, you&#39;re all here! I am the Demon King of the Sixth Heaven from the Beach, yeah, it&#39;s me, Nobunaga THE Rock Roller!</p><p>Thank you, thank you for gathering here today to see me, Honnouji! Let&#39;s enjoy the burning Summer heat together, everyone! There might be some wardrobe malfunctions too!</p><p>Man, thinking back, it was quite a long journey to get here... The period of obscurity as the straightforward Owari Fool, the desperate situation of the Okehazama Live Contest where I managed to achieve the impossible and triumph over the Imagawa Ojaru band that was said to be the most likely to win the contest, the Nobbu songs encircled by the idols Kenshin-chan and Shingen-chan (their relationship as a duo is the worst) from the rival production, Kawanakajima, and then my dream of marching to the capital for the Kyouto singing competition performance, and then lastly, the shocking interview about my retirement following the unexpected Honnouji scandal... As expected, it was an unforeseen development even for me.</p><p>However..., HOWEVER! Overcoming the trials and tribulations, I have returned! That&#39;s right, I am the immortal rock &#39;n&#39; roller, Oda Nobunaga! Everyone, go ahead and enjoy the sight of Nobu in a swimsuit! Enjoy it! Enjoy it!</p><p>And now, I&#39;ll pour these flood of emotions into my singing... The legendary melody heating up Owari&#39;s Summer of 2017, &quot;Tenka Fubu ~2017 summer.ver~&quot;, listen to my so~ng!!</p><p>Eh? &quot;Nobunaga&#39;s not playing the guitar&quot;? No, even if you say that, I&#39;m the people&#39;s Demon Lord of the Sixth Heaven.</p><p>Actually, is this even a guitar?</p><h2 id="standard-weapons" tabindex="-1"><a class="header-anchor" href="#standard-weapons" aria-hidden="true">#</a> Standard Weapons</h2><p>Heshi Kill Hasebe. An enigmatic guitar-type weapon carried on Swimsuit Nobbu&#39;s shoulder. Eh? It&#39;s got a weird name? Nah, this one&#39;s pretty badass. There is a skull on it and the pointy bits will hurt a lot when I hit things with it.</p><p>And look, when I hold it sideways, I can do DJ Nobbu-like stuff with it too. Eh? &quot;That&#39;s why I&#39;m asking what the heck is it&quot;, you say? Isn&#39;t it obvious that... yeah, what the heck is this thing!?</p><h2 id="related-characters" tabindex="-1"><a class="header-anchor" href="#related-characters" aria-hidden="true">#</a> Related Characters</h2><p><strong>Okita Souji</strong></p><p>Ma~n, sorry, sorry, I ended up getting a swimsuit version earlier than you. Since I am a popular character, it couldn&#39;t be helped. Okita should keep persevering without giving up too so you&#39;ll get a swimsuit. Well, naturally, the next one will be my \u26065 version, you see! Uhhahhahhaha! ......Eh? Okita Alter? ......Huh? From \u26065 to \u26065?</p><p><strong>Chacha</strong></p><p>Hm? Chacha wants a swimsuit too? Mm~, I think a sexy swimsuit like mine would be a bit early for Chacha... Mn? &quot;In Yodogimi[1] Mode, Auntie wouldn&#39;t even hold a candle to my curves&quot;? Hold it! I&#39;ve got splendid curves as well! Don&#39;t I?</p><p><strong>Oda Nobunaga</strong></p><p>Ha!? Who is this transcendently beautiful Sengoku bishoujo daimyo!? ...Ah, what, aren&#39;t you my Archer version, you startled me. Nevertheless, such an overly beautiful Sengoku daimyo could only be me, after all! Uhhahhahhahha! By the way, my breasts are a bit larger, aren&#39;t they.</p><p><strong>Swimsuit Raikou</strong></p><p>As expected of the boobs of the Minamoto Clan&#39;s chief! I am from the Tairas and it&#39;s not like I am lacking in the chest department, but it&#39;s my loss when it comes to those boobs. Eh? Could it be that&#39;s how the Tairas lost too? (Wrong)</p><p><strong>Swimsuit Nero</strong></p><p>That Nanban&#39;s[3] armor... Are they shoulder pads? It&#39;s really cool biz! Speaking of which, isn&#39;t your Noble Phantasm too lovely!? That impossible frontal cut-in[4] is at a level that even Ranmaru[5] would be paralyzed with fear.</p><p><strong>Swimsuit Nitocris</strong></p><p>Eh? What&#39;s with that cover. Eh? Medjed deity? I, I see... I won&#39;t inquire any deeper. By the way, that tuft of hair jutting out from her rear is super cute!</p><p><strong>Mysterious Racer X</strong></p><p>Oh! You&#39;re the one who lent me a hand in the race! Eh? &quot;My name is Mysterious Heroine X&quot;? Eeeh? Really? Aren&#39;t you that mysterious Assassin said to be a shooting star glittering in the night sky that will appear again when there is a Saber to be defeated?</p><h2 id="comment-from-the-illustrator" tabindex="-1"><a class="header-anchor" href="#comment-from-the-illustrator" aria-hidden="true">#</a> Comment from the Illustrator</h2><p>An &quot;I wish she&#39;d calm down a little&quot;-type Servant. However, she can not calm down. That is fine. She&#39;ll burn everything while laughing. Her skills being plain and simple are really helpful so once you get used to using her, she is a Servant you simply can&#39;t replace... Ah... The NP gauge is not enough for the third wave... (pako)</p><h2 id="translation-notes" tabindex="-1"><a class="header-anchor" href="#translation-notes" aria-hidden="true">#</a> Translation Notes:</h2><p>[1] The literal translation is \u201CDemon King of the Sixth Heaven of the Beach\u201D or \u201CThe Beach\u2019s Demon King of the Sixth Heaven\u201D, but these sounded weird to me so I went with the above version.</p><p>[2] Yodogimi (\u6DC0\u541B) or Yodo-dono (\u6DC0\u6BBF) is Chacha&#39;s adult name. ...So Chacha would grow up to be a busty beauty? Adult Chacha when DW?</p><p>[3] Barbarian (\u5357\u86EE). That&#39;s how Japanese people referred to Westerners back then.</p><p>[4] Not sure about this part. Original is &quot;\u307E\u3055\u304B\u306E\u6B63\u9762\u30AB\u30C3\u30C8\u30A4\u30F3&quot;.</p><p>[5] Nobunaga is referring to Mori Ranmaru (\u68EE\u862D\u4E38) here, one of her most loyal attendants. He (or maybe she in Nasuverse, who the hell knows at this point) was known for his (her?) talent, loyalty, and unusual beauty and remembered throughout history for his (her?) bravery and devotion for his (her?) decision to commit seppuku and follow Nobunaga in death. Ah, yes, there&#39;s also the thing where most of the literature from the Edo period claims that they had a sexual relationship. Nobunaga and Ranmaru, I mean.</p><h2 id="material-images" tabindex="-1"><a class="header-anchor" href="#material-images" aria-hidden="true">#</a> Material Images</h2><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-V/i-280.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-V/i-281.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-V/i-282.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-V/i-283.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-V/i-284.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-V/i-285.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-V/i-286.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-V/i-287.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-V/i-288.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-V/i-289.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-V/i-290.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-V/i-291.jpg?raw=true" alt=""></p><h2 id="dialogue" tabindex="-1"><a class="header-anchor" href="#dialogue" aria-hidden="true">#</a> Dialogue</h2><table><thead><tr><th style="text-align:left;">Occassion</th><th style="text-align:center;">English</th><th style="text-align:center;">Japanese</th></tr></thead><tbody><tr><td style="text-align:left;">Summoned</td><td style="text-align:center;"></td><td style="text-align:center;"></td></tr></tbody></table>', 103);
